import React, { useState, useEffect } from 'react'
import axios from 'axios'
import{ Link } from "react-router-dom";

const Feed = () => {
    const [photo,setPhotos] = useState([])

    useEffect(() => {
        const fetchAllPhotos = async () => {
            try{
                const res = await axios.get("http://localhost:8800/photos")
                setPhotos(res.data);
            }
            catch(err){
                console.log(err)
            }
        }
        fetchAllPhotos()
    },[])
//{<img src = "photos.data" alt="" />}
    return <div>
        <h1>Welcome!</h1>
        <div className = "photos">
            {[...photo].reverse().map((photos)=>(
                <div className = "photos" key={photos.photo_id}>
                    <h2>{<Link to={`/photo-view`} state={{photoID:photos.photo_id}}> <img src={photos.data} width='500' height='500' /> </Link>}</h2>
                    <p>{photos.caption}</p>
                </div>
            ))}
        </div>
    </div>;
}

export default Feed
